import React, { useState, UseState } from "react";
import { FaLocationArrow } from "react-icons/fa";
import { Link } from "react-router-dom";
import "./App.css";

function Nav() {
  const navStyle = {
    textDecoration: "none",
    color: "inherit",
  };

  function hover(e) {
    e.target.style.fontWeight = "800";
  }

  function normal(e) {
    e.target.style.fontWeight = "600";
  }

  return (
    <nav>
      <ul>
        <Link
          className="home"
          to="/"
          style={navStyle}
          onMouseEnter={hover}
          onMouseLeave={normal}
        >
          <li>Home</li>
        </Link>
        <button>
          <FaLocationArrow className="location-btn" />
        </button>
        <Link to="/login" style={navStyle}>
          <li>Login</li>
        </Link>
      </ul>
    </nav>
  );
}

export default Nav;
